import React, { useEffect } from 'react'
import styles from './List.module.css'
import { useSelector } from 'react-redux';
import { selectPurposes } from '../../../redux/plan-selectors.ts';

const ListOfWork = () => {
    const list = useSelector(selectPurposes)
    return (
        <>
        {list.length > 0 && <ul className={styles.listOfWork}>
            {list.map((item) => <div className={styles.item}>
                <b className={styles.text}>{item.text}</b>
                <p className={styles.text}>{item.data}</p>
                <button className={styles.button} >+</button>
            </div>)}
        </ul>}
        </>
    )
}

export default ListOfWork
